import { Link } from "react-router-dom";
import "../App.css";

function SignupForm(){
    return (
        <div id="div-box">
            <h1>Sign Up</h1> <hr/>

            <form action="@/user" method="POST">
                <input type="text" name="id" placeholder="Member ID"/> <br/>
                <input type="password" name="password" placeholder="Password"/> <br/>
                <input type="text" name="username" placeholder="Nickname (default='unknown')"/> <br/>
                <input type="radio" name="auth" value="ROLE_ADMIN, ROLE_USER" style={{"width": "30px"}}/> ADMIN <br/>
                <input type="radio" name="auth" value="ROLE_USER" defaultChecked="checked" style={{"width": "30px"}}/> USER <br/>
                <button type="submit" id="btn-post">Join</button>
            </form>

            <Link id="none" to="/"><button id="btn-default">Go to Login â†’</button></Link>
        </div>
    )
}

export default SignupForm;
